import React from "react";
import video from "../../../video/5194-183786499_small.mp4";

const Hero = () => {
  return (
    <div className="hero">
      <video src={video} autoPlay muted loop className="video"></video>
      <div className="content"></div>
    </div>
  );
};

export default Hero;
